import React, { useState, useEffect } from 'react';
import { useHistory, useParams } from "react-router-dom";
import { Button, PageHeader, Input, AutoComplete, Menu, Row, Col, Empty, Select, Collapse, Table, Radio } from 'antd';

import mondaySdk from "monday-sdk-js";
const { Search } = Input;
const { Option } = Select;
const { Panel } = Collapse;

const monday = mondaySdk();



const HistoryView = () => {
    const backButton = useHistory()

    function clickBackButton(){
        backButton.push('/')
    }

    return (
        <div className="container">
            <PageHeader
                className="site-page-header"
                onBack={clickBackButton}
                title="Super Search History"
                subTitle="View your past searches, all stored securely on monday.com!"
            />
        </div>
    )
}

export default HistoryView
